import React from 'react';
import logo from '../assets/idc-logo.jpg';

const HeroSection = () => (
  <section className="hero">
    <img src={logo} alt="IDC Logo" className="hero-logo" />
    <h1>Empowering Developers, Connecting Innovators</h1>
    <p>Welcome to the Indian Developer Community</p>
  </section>
);

export default HeroSection;
